import merchant from "../fixtures/merchant.json"
import manajer from "../fixtures/manajer.json"

class ProjectsPage {

    // Create Project
    createProject() {
        cy.request({
            method: 'POST',
            url: `https://app.stage.paydo.com/v1/apps/create`,
            headers: {
                token: merchant.token,
            },
            body: {
                "name": "MyNewProject",
                "info": "non-specialized wholesale trade",
                "site": "https://app.stage.paydo.com/my.new.project",
                "ipn": "https://non-specialized wholesale trade",
                "logo": "data:image/jpeg;base64,",
                "logoSrc": "data:image/jpeg;base64,",
                "amountInfo": {
                    "minAmount": {
                        "value": 0.01,
                        "currency": "EUR"
                    },
                    "averageAmount": {
                        "value": 1000,
                        "currency": "EUR"
                    },
                    "maxAmount": {
                        "value": 10000,
                        "currency": "EUR"
                    },
                    "expectedVolume": {
                        "value": 10000,
                        "currency": "EUR"
                    }
                },
                "checkoutPageCustomization": {
                    "logoSrc": "data:image/jpeg;base64,"
                }
            }
        }).then((response) => {
                 expect(response).property('status').to.equal(201)
                 })
    }


    // Install the Can use cardtoken checkbox
    onUseCardToken() {
        cy.request({            //получение идентификатора проекта по ID мерчанта и PROJNAME
            method: 'GET',
            url: "https://app.stage.paydo.com/v1/apps/filters?query[userIdentifier]="+merchant.bussiness_account+"&query[name]=MyNewProject",
            params: {
                "query[userIdentifier]": merchant.bussiness_account  // нужен ли параметр?
            },
            headers: {
                token: manajer.token
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200)
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            let projident = response.body.data[0].identifier

            cy.request({        //can use card token +
                method: 'POST',
                url: "https://app.stage.paydo.com/v1/apps/"+projident+"/update-manager",   //'+projident+' конкатенация и кавычки для передачи значения айди запроса
                headers: {
                    token: manajer.token,
                },
                body: {
                    "name": "MyNewProject",
                    "info": "non-specialized wholesale trade",
                    "site": "https://app.stage.paydo.com/my.new.project",
                    "ipn": "https://non-specialized wholesale trade",
                    "canUseCardToken": true,
                    "cashRegisterType": "default",
                    "midIdentifier": 0,
                    "logo": "data:image/jpeg;base64,",
                    "newStatus": null,
                    "logoSrc": "data:image/jpeg;base64,",
                    "amountInfo": {
                        "minAmount": {
                            "value": 0.01,
                            "currency": "EUR"
                        },
                        "averageAmount": {
                            "value": 1000,
                            "currency": "EUR"
                        },
                        "maxAmount": {
                            "value": 10000,
                            "currency": "EUR"
                        },
                        "expectedVolume": {
                            "value": 10000,
                            "currency": "EUR"
                        }
                    },
                    "checkoutPageCustomization": {
                        "logoSrc": "data:image/jpeg;base64,"
                    }
                }
            }).then((response) => {
                expect(response).property('status').to.equal(201)
            })
        })
    }


    acceptProject() {
        cy.request({    //получение идентификатора проекта по ID мерчанта и PROJNAME
            method: 'GET',
            url: "https://app.stage.paydo.com/v1/apps/filters?query[userIdentifier]="+merchant.bussiness_account+"&query[name]=MyNewProject",
            params: {
                "query[userIdentifier]": merchant.bussiness_account
            },
            headers: {
                token: manajer.token
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200)
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            let projident = response.body.data[0].identifier

            cy.request({  // accept project
                method: 'POST',
                url: "https://app.stage.paydo.com/v1/apps/" + projident + "/accept",
                params: {
                    "query[userIdentifier]": merchant.bussiness_account // нужны ли здесь параметры?
                },
                headers: {
                    token: manajer.token
                }
            }).then((response) => {
                expect(response).property('status').to.equal(200)
                expect(response.body).property('data').to.not.be.oneOf([null, ""]);

            })
        })
    }
}

export default new ProjectsPage();